import React from "react";
import "./RowList.css";
import Row from '../Row/Row';

// create 5 rows in a vertical fashion
const RowList = () => {
    return(
        <div>
            <Row />
            <Row />
            <Row />
            <Row />
            <Row />
        </div>
    );
}

export default RowList;
